import React from 'react';
import {Stack, Navbar, Button} from 'react-bootstrap';

export default function HomePage(){
    return(
        <Stack direction='vertical'>
            <Navbar title='CHECK-IT'>
                <Button>Abmelden</Button>
            </Navbar>
        </Stack>
    );
}
